records.addlTxt:
Counsel waived.
GUILTY plea entered to count 2, obstruct officer.  Convicted.
The State moves to dismiss and read in count 1.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for one (1) year.
Conditions of probation:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Provide a DNA sample;
3) Maintain fulltime employment, schooling or combination;
4) Maintain absolute sobriety;
5) No contact with the victim, S.D.;
6) Complete forty (40) hours of community service;
7) Spend thirty (30) days in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court;
8) Pay court costs;
9) pay supervision fees in an amount to be determined by DOC.
Expungement is ordered under Section 973.015 upon successful completion of the sentence.  The Court finds that the defendant will benefit and society will not be harmed by expungment in this matter.
Minutes.
